import React from 'react';
import './ReviewSection.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import '@fortawesome/fontawesome-free/css/all.min.css';

const ReviewsSection = () => {
  const reviews = [
    {
      id: 1,
      name: "Meher",
      field: "Web Development",
      rating: 5,
      review: "Outstanding work on our e-commerce platform. The code quality is exceptional and the project was delivered ahead of schedule.",
      avatar: "M",
      date: "2 weeks ago"
    },
    {
      id: 2,
      name: "Syamanth",
      field: "Mobile App Development",
      rating: 4.5,
      review: "Incredible attention to detail in our React Native app. The performance optimizations exceeded our expectations.",
      avatar: "S",
      date: "1 month ago"
    },
    {
      id: 3,
      name: "Meher",
      field: "UI/UX Design",
      rating: 4,
      review: "Great design skills and creative approach to our brand identity. Final deliverables were top-notch.",
      avatar: "C",
      date: "3 weeks ago"
    },
    {
      id: 4,
      name: "Hari",
      field: "Backend Development",
      rating: 3.5,
      review: "Solid backend architecture and security implementations. Very knowledgeable and reliable developer.",
      avatar: "H",
      date: "1 week ago"
    },
    {
      id: 5,
      name: "Kalyan",
      field: "Full Stack Development",
      rating: 3,
      review: "Complete full-stack solution delivered perfectly. Everything was seamlessly integrated and documented.",
      avatar: "K",
      date: "4 days ago"
    }
  ];

  const renderStars = (rating) => {
    const fullStars = Math.floor(rating);
    const hasHalfStar = rating % 1 !== 0;
    const stars = [];

    for (let i = 0; i < 5; i++) {
      if (i < fullStars) {
        stars.push(<i key={i} className="fas fa-star star-icon" />);
      } else if (i === fullStars && hasHalfStar) {
        stars.push(<i key={i} className="fas fa-star-half-alt star-icon" />);
      } else {
        stars.push(<i key={i} className="far fa-star star-icon" />);
      }
    }
    return stars;
  };

  const getAverageRating = () => {
    const total = reviews.reduce((sum, review) => sum + review.rating, 0);
    return (total / reviews.length).toFixed(1);
  };

  return (
    <section className="reviews-wrapper">
      <div className="container reviews-container">
        <div className="text-center mb-5">
          <h2 className="fw-bold">Client Reviews</h2>
          <p className="text-muted">See how businesses around the world benefit from our services.</p>
          <div className="d-flex justify-content-center align-items-center gap-2">
            {renderStars(getAverageRating())}
            <span className="ms-2 fw-semibold">{getAverageRating()}</span>
            <span className="text-muted">({reviews.length} reviews)</span>
          </div>
        </div>

        <div className="row g-4">
          {reviews.map((review) => (
            <div key={review.id} className="col-md-6 col-lg-4">
              <div className="card h-100 shadow-sm review-card">
                <div className="card-body">
                  <div className="d-flex justify-content-between mb-3">
                    <div className="d-flex align-items-center gap-3">
                      <div className="avatar text-white rounded-circle d-flex justify-content-center align-items-center">
                        {review.avatar}
                      </div>
                      <div>
                        <h5 className="mb-0">{review.name}</h5>
                        <small className="text-muted">{review.field}</small>
                      </div>
                    </div>
                    <div className="text-end">
                      <div className="d-flex justify-content-end">{renderStars(review.rating)}</div>
                      <small className="text-muted">{review.date}</small>
                    </div>
                  </div>
                  <p className="fst-italic text-secondary">"{review.review}"</p>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default ReviewsSection;
